import React from "react";
import spacesList from '.../public/api/spaces.json';

class List extends React.Component { 

  createList = spacesList.map((id) => // json спосик нужен
    <li>{id}</li>
  );

  render() {
    return(
      <ul>
        {this.createList}
      </ul>
    )
  }
}

export default List;
